                    <h1 style={{fontWeight:"800", fontSize:"50px"}}>Front-end React Developer</h1>
                    <p>Hi, I'm Siddharth, a passionate Front-end React Developer based in Mumbai</p>
                </section>
                <section className='main-image'>
                    <img height={150} width={150} src='https://media.licdn.com/dms/image/D5603AQGlm9DcyVwwtw/profile-displayphoto-shrink_800_800/0/1679600457584?e=1692230400&v=beta&t=RQ38IMb3hcIa3844ZpS9YGh2ASVs4WkAQyQfeVEe-78' />
                </section>
            </div>
        </>
    )
}

export default Hero
